package test.spyd;

public class logicalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method 

		int a=10;
		
		int b=5;
		
		System.out.println(a<b);//f
		
		System.out.println(a<=b);//f
		
		System.out.println(a>b);//t
		
		System.out.println(a>=b);//t
		
		//.out.println(a=b);//f
		
		System.out.println(a!=b);//
		
		System.out.println(a=b);
		
		

	}

}
